import { Route, Switch, Redirect } from "react-router-dom";
import Home from "./pages/Home";
import Away from "./pages/Away";
import Middle from "./pages/Middle";

function App() {
  return (
    <section>
      <Switch>
        <Route path="/" exact>
          <Redirect to="/quotes" />
        </Route>
        <Route path="/quotes" exact>
          <Home />
        </Route>
        <Route path="/middle">
          <Middle />
        </Route>
        <Route path="/quotes/:id">
          <Away />
        </Route>
      </Switch>
    </section>
  );
}

export default App;
